import React from "react";

const Display = (props) => {
    console.log(props.finalres);
    return ( <>
    <p className="text-[#00df9a]">Ares in acres :{props.finalres.area_ac}</p>
    <p className="text-[#00df9a]">Price : {props.finalres.price}</p>
    <p className="text-[#00df9a]">{props.finalres.street}</p>
    </>);
}
 
export default Display;
